import React, { useState } from 'react';

const Search = () => {
    const [search, setSearch ] = useState('');
    return (
        <div>
            <div className="ui form">
                <div className="field">
                    <input 
                    value={search}
                    onChange={e => setSearch(e.target.value)}
                    className="input" placeHolder="Enter Search Term" />
                </div>
            </div>
        </div>
    );
}

export default Search;
